import {BrowserRouter as Router,
  Routes,
  Route,Link
  } from 'react-router-dom'
import Home from './screens/Home';
function App() {
  return (
    <Router>
      <Route exact path='/' element={<Home/>}/>
    </Router>
  );
}

export default App;
